import React from "react";
import SensorEventForm from "./SensorEventForm";

const SensorEvents = () => {
  const [sensorsEvents, setSensorsEvents] = useState([]);

  const loadSensorEvents = async () => {
    const resp = await getSensorsEvent();
    console.log(resp);
    setSensorsEvents(resp.data);
  };

  useEffect(() => {
    loadSensorEvents();
  }, []);

  return (
    <div className="container d-flex justify-content-center">
      <div className="row align-items-start">
        <div className="row d-flex">
          <br />
          {sensorsEvents.map((sensor) => {
            return <SensorEventsItem sensor={sensor} key={sensor._id} loadSensor={loadSensorEvents}/>;
          })}
        </div>
      </div>
    </div>
  );
};

export default SensorEvents;
